__NUXT_JSONP__("/drugs/Conbercept", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1227158-72-6",chebiId:b,chemicalFormula:b,definition:"A recombinant, soluble, vascular endothelial growth factor receptor (VEGFR) protein composed of the second immunoglobulin (Ig) domain of VEGFR-1, the third and fourth Ig domains of VEGFR-2, and the constant region (Fc) of human immunoglobulin G1 (IgG1) with potential anti-angiogenic activities. Upon intravitreal injection, conbercept, functioning as a soluble decoy receptor, binds with high affinity to all VEGF-A isoforms, VEGF-B, as well as placenta growth factor (PlGF)-1 and PlGF-2. This prevents the binding of these growth factors to their endogenous receptors, potentially inhibiting angiogenesis and tumor cell growth.",fdaUniiCode:"1P05PW62F3",identifier:"C162879",preferredName:a,semanticType:"Amino Acid, Peptide, or Protein",subclassOf:["C1512","C1742"],synonyms:["CONBERCEPT",a,"FP 3","FP-3","FP3","KH 902","KH 903","KH-902","KH-903","KH902","KH903"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FConbercept",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Conbercept","","2021-10-30T13:35:29.973Z")));